import '../App.css';
import {BrowserRouter, Routes, Route, NavLink} from 'react-router-dom';
import Base from '../components/Base';
import Upgrade from '../components/Upgrade';

const App = () => {
  return (
    <BrowserRouter>
    <div>
      <Routes>
        <Route path="/" exact={true} element={<Base />} />
        <Route path="/direction" element={<Upgrade />} />
      </Routes>
      <header>
        <div className="container-header">
          <h1>Nader React Website</h1>
          <h2> Enjoy!</h2>
        </div>
      </header>
      <nav className="nav">
        <NavLink to='/'>Home</NavLink>
        <NavLink to='/direction'>Redirect</NavLink>
      </nav>
      <div className="main">
      </div>
    </div>
  </BrowserRouter>
  )
}

export default App;
